// src/App.js
import React, { useState, useContext, useEffect } from 'react';
import { OrderProvider, OrderContext } from './contexts/OrderContext';
import MenuPanel from './components/Menu/MenuPanel';
import OrderPanel from './components/Order/OrderPanel';
import ReceiptModal from './components/Receipt/ReceiptModal';
import ReportsDashboardPage from './pages/ReportsDashboardPage';

// Import all component-specific CSS files here or ensure they are imported in index.css or their respective components
import './assets/styles/Menu.css';
import './assets/styles/Order.css';
import './assets/styles/Receipt.css';
// import './assets/styles/Reports.css'; // If you create one for reports

const POS_VIEW = 'POS_VIEW';
const REPORTS_VIEW = 'REPORTS_VIEW';

// AppContent component
const AppContent = ({ currentView, setCurrentView }) => {
  const [isReceiptModalOpen, setIsReceiptModalOpen] = useState(false);
  const [receiptDataForModal, setReceiptDataForModal] = useState(null);

  // Destructure from OrderContext
  const { 
    processAndSubmitOrder, 
    currentOrder,
    generateOrderId,
    isSubmittingOrder, 
    submissionError,
    clearOrder // For the error message close button
  } = useContext(OrderContext); // Use OrderContext here

  // Clear submission error when view changes or modal state changes
  useEffect(() => {
    if (submissionError && clearOrder) { // clearOrder also clears submissionError in context
        // This is a bit of a hack, ideally submissionError state would be managed more directly
        // For now, if there's an error, and user navigates, it should implicitly clear or be handled.
    }
  }, [currentView, isReceiptModalOpen, submissionError, clearOrder]);


  const handleProcessPayment = async () => {
    if (currentOrder.length === 0) {
      alert("សូមបន្ថែមទំនិញជាមុនសិន!");
      return;
    }
    try {
      // You might want to add a payment method selection step here
      const submittedOrderDetails = await processAndSubmitOrder("Cash"); // Example: "Cash"

      if (submittedOrderDetails) {
        // Prepare data specifically for this receipt instance
        setReceiptDataForModal({
            orderItems: [...currentOrder], // CRITICAL: Snapshot currentOrder items for this receipt
            orderId: submittedOrderDetails.orderNumber || generateOrderId(), // Use backend's order number or generate
            backendResponse: submittedOrderDetails // Store full response if needed for receipt
        });
        setIsReceiptModalOpen(true);
        // OrderContext.prepareForNewOrder() is called inside ReceiptModal when it closes
      } else {
        // submissionError is set in OrderContext, display it if necessary
        // The alert below is a fallback.
        if(submissionError) alert(`ការបញ្ជូនបានបរាជ័យ: ${submissionError}`);
      }
    } catch (error) {
      // Error is already logged by OrderContext, show a user-friendly message
      // The alert in OrderContext might be sufficient, or add one here
      // alert("មានបញ្ហាពេលបញ្ជូនការបញ្ជាទិញ។ សូមព្យាយាមម្តងទៀត។");
    }
  };

  const handleCloseReceiptModal = () => {
    setIsReceiptModalOpen(false);
    setReceiptDataForModal(null); // Clear data for the closed receipt
    // The OrderContext's prepareForNewOrder is called from within ReceiptModal's close handler
  };

  return (
    <>
      <nav className="app-navigation">
        <button 
            onClick={() => setCurrentView(POS_VIEW)} 
            className={currentView === POS_VIEW ? 'active' : ''}
        >
            ប្រព័ន្ធលក់ (POS)
        </button>
        <button 
            onClick={() => setCurrentView(REPORTS_VIEW)}
            className={currentView === REPORTS_VIEW ? 'active' : ''}
        >
            របាយការណ៍ (Reports)
        </button>
      </nav>

      {isSubmittingOrder && <div className="loading-overlay">កំពុងបញ្ជូនការបញ្ជាទិញ...</div>}
      {submissionError && !isSubmittingOrder && ( // Show error only if not currently submitting
        <div className="error-message-global">
            បញ្ហា៖ {submissionError} <button onClick={() => clearOrder()} style={{marginLeft: '10px', fontSize:'0.8em'}}>បិទ</button>
        </div>
      )}


      {currentView === POS_VIEW && (
        <div className="pos-main-container">
          <MenuPanel />
          <OrderPanel 
            onProcessPayment={handleProcessPayment} 
            isProcessing={isSubmittingOrder} 
          />
        </div>
      )}

      {currentView === REPORTS_VIEW && (
        <div className="page-container">
          <ReportsDashboardPage />
        </div>
      )}

      {/* Receipt Modal is available regardless of view, but opened from POS view */}
      {receiptDataForModal && (
          <ReceiptModal
            isOpen={isReceiptModalOpen}
            onClose={handleCloseReceiptModal}
            receiptDataForDisplay={receiptDataForModal}
          />
      )}
    </>
  );
};


// Main App component that includes the Provider
function App() {
  const [currentView, setCurrentView] = useState(POS_VIEW); // Default view

  return (
    <OrderProvider>
      <AppContent currentView={currentView} setCurrentView={setCurrentView} />
    </OrderProvider>
  );
}

export default App;
